import React, { Component } from "react";
import { Document } from "react-pdf";

class Resume extends Component {
  render() {
    return (
      <div>
        <Document
          file="../Resume_Harsh_Patel.pdf"
          onLoadSuccess={this.onDocumentLoadSuccess}
        />
      </div>
    );
  }
}

export default Resume;
